  <style>
    @media print {
        @page {
            size: landscape
        }
    }

    .root {
        width: fit-content;
        margin: auto;
    }

    .day {

        width: 100px;
        height: 21px;
        background-color: #c7c7c7;
        border: gray;
        border-style: solid;
        border-width: thin;
        font-size: 10px;
    }

    .weekEnd {
        background-color: #54ecbc;
    }

    .weekEndU {
        background-color: #988fe8;
    }

    .weekEndY {
        background-color: #50a2e1;
    }

    .dayNumber {
        float: inline-end;

    }

    .dayName {

        float: inline-start;

        font-size: 8px;
        font-weight: bold;
    }

    .perso {


        text-align: center;
        font-weight: bold;
        font-size: 11px;
        display: flex;
        justify-content: center;
    }
    .today{
        background-color: red;  
    }

    .month {
        text-align: center;
        display: inline-block;
        vertical-align: top;
    }
</style>
